import React from "react";


function TopMovies() {
  return (
    <div>
        <ul className="list">
        {
          data.movies.map(movie =>
            <li>
              <div className="movie">
                <img className="movie-image" src={movie.backgroundImg} />
                <div className="movie-name">{movie.title}</div>
              </div>
            </li>
          ).slice(0, 5)
        }
      </ul>  
    </div>
  );
}

export default TopMovies;
